import React from 'react';
import RotatingImage from './RotatingImage';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <center>
        <RotatingImage />
        <div className="google-gemini-text">
          <h2>Google Gemini Animation</h2>
        </div>
        <div className="task-description">
          <p>Liquid Galaxy Task 5 # 2: Gemini UI by Jaivardhan Shukla</p>
        </div>
      </center>
    </div>
  );
}

export default App;
